import { useCallback } from "react";

// Extends ProfileTotal //
export default function ProfileTotalInput({style, props}) {

  // Event listener to check items/page value on user input // 
  const onKeyPress = useCallback(e => {
    if (e.key === "Enter") props.setTotalToRenderNumber(props.userInputRecord);
  }, [props.setTotalToRenderNumber, props.userInputRecord]);


  // Renders items/page element //
  return (
    <div style={style.totalInputContainer}>
      <div style={style.totalTitleOther}>Items/Page</div>

      {/* Renders input element for items/page referencing onKeyPress */}
      <input
          placeholder={props.totalToRenderNumber} 
          style={style.totalInput} 
          onChange={e => props.setUserInputRecord(parseInt(e.target.value))}
          onKeyPress={onKeyPress}/>

      {/* Renders the enter button for items/page */}
      <div 
          style={style.totalButton}
          onClick={() => props.setTotalToRenderNumber(props.userInputRecord)}>
        <div style={style.totalButtonLine}></div>  
      </div>

    </div>
  );
};
